import React from "react";
import AuthLayout from "../components/AuthLayout";

/**
 * Login Page
 */
const Login = () => {
  return (
    <AuthLayout title="Sign in to DineEase">
      <h1>Sign in</h1>
      <span>You can Register here!</span>
    </AuthLayout>
  );
};

export default Login;
